</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Disclaimer</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p><p>The authors of this report are in no way responsible for the behavior of materials</p><p>or the drawbacks that may occur with time depending on the selection of the</p><p>Samples / environment to which the building exposed / less curing and also&nbsp;</p><p>materials stored.&nbsp; This report has been prepared based on the location of samples&nbsp;</p><p>selected area for assessing the quality of in-situ concrete as per authority&nbsp;</p><p>identification / request.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp; &nbsp;&nbsp;</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;Acknowledgement</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;The authors of this report wish to thank the authorities for sponsoring this work&nbsp;</p><p><strong>XXXXXXXXXXXXXXXX,&nbsp;</strong></p><p>for making arrangement of site during our test.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>C O N T E N T S</strong></p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>A. &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;INTRODUCTION</strong></p><p>&nbsp;</p><p><strong>B.&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;SEMI - DESTRUCTIVE TEST</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; C.&nbsp; &nbsp; &nbsp; &nbsp; RESULTS OF TEST</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ACCEPTANCE CRITERIA</strong></p><p>&nbsp;</p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;REMARKS</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>APPENDIX</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>CORE RESULTS - Table 1&nbsp;</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ol><li><strong>INTRODUCTION.</strong></li></ol><p>&nbsp;</p><p>&nbsp;&nbsp; &nbsp;&nbsp; The Construction of <strong>XXXXXXXXXXXXXXXXXXXXXXXXXXXXXX, </strong>Constructions by&nbsp;<strong>M/s XXXXXXXXXX</strong><i>.,&nbsp;</i>it is under progress, As a part of quality check, a reference was made to us to conduct Concrete Core Compressive Strength test on r.c. members to ascertain the quality of in-situ concrete.&nbsp; In response to this the above tests was conducted by us during XXXXXXX.</p><p>This report in brief, depicts the details of tests conducted and the results of tests.</p><p>&nbsp;</p><ol><li><strong>DETAILS OF SEMI-DESTRUCTIVE TEST (Core test)</strong></li></ol><p><strong>CORE TEST:</strong></p><p>Three numbers of concrete core samples were extracted from Identified (By Client) r.c. members, using core cutting equipment to ascertain the compressive strength of in-situ concrete. The locations of core extraction were identified by the concerned authorities at the site. The extracted concrete cores after necessary trimming and capping as per relevant guidelines in IS 516-(Part4): 2018 and IS: 456-2008, were subjected to compressive strength test the test results of core samples are tabulated in the enclosed Table –1. The location for core sampling can be selected based on the guidelines IS 456-2008 &amp; IS 516-(Part4): 2018.&nbsp; Observation of the core may give an idea of the aggregate type, size, location and size of the reinforcement, honeycombing, cracks etc.&nbsp; Condition of concrete can interpreted after the visual examination of the core is completed. Core test is one of the best methods to assess the strength of the concrete in RCC construction.&nbsp; Compression testing examination of cores is a well-established and most reliable method and also enabling visual inspection of the interior regions and direct estimation of the strength.&nbsp; In this method, cores of various sizes and lengths are cut from the hardened concrete by using core cutting machine.&nbsp; A typical core cutting machine is Diamond core cutter.&nbsp; The cores can be tested for density, compressive strength and chemical analysis etc.&nbsp; The strength test of cores provides almost a direct evidence on the quality of concrete as it exists on the structure. &nbsp;Care must be taken in interpreting the strength test results of cores, since number of factors, such as diameter of core; slenderness ratio, core location and cutting condition influence the results and the relationship with cube strength.&nbsp; &nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><ol><li><strong>RESULTS OF TEST:</strong></li></ol><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;The result of core test indicates that the compressive strength of in-situ concrete in the tested cores extracted from the identified r.c. Member results are tabulated in the table- 1</p><p>&nbsp;</p><p><strong>D</strong>.<strong> ACCEPTANCE CRITERIA:</strong></p><p>&nbsp; &nbsp;&nbsp; &nbsp; &nbsp;&nbsp;<strong>As per the clause 17.4.3 of IS: 456-2008, concrete in the member represented by a core test Shall be considered acceptable if the average equivalent cube strength of the cores is equal to at least 85% - MXXX = XXX N/mm2&nbsp;of the cube strength of grade of concrete specified for the corresponding age and no individual core has strength less than 75% - M55 = XXX N/mm2&nbsp;.&nbsp;</strong></p><ol><li><strong>REMARKS:</strong></li></ol><p>&nbsp; &nbsp; &nbsp; &nbsp;Based on the above results, the acceptance or otherwise of the concrete in the tested RC Members is the prerogative of the concerned structural consultant / authorities at site.</p><p>Note:</p><p>1. This test report refers only to the sample submitted for testing.</p><p>2. This test report is valid at the time of and under the conditions specified herein.&nbsp;</p><p>3. This test report may not be reproduced in part or full, without the permission of this laboratory.</p><p>4. Any correction made will invalidate this test report.</p>',2,1,2,1),(80,'Mix Design','2024-01-30 09:46:34.217083','2024-12-23 12:42:54.985952','<h2><strong>To: M/S PRAGATI INFRA SOLUTION PVT LTD</strong></h2><h2><strong>Project: C/o:&nbsp;M/S GMR LOGITICS PVT LTD</strong></h2><h2><strong>Index</strong></h2><figure class=\"table\"><table><tbody><tr><td><strong>S.No</strong></td><td><strong>Report</strong></td><td><strong>Page&nbsp;No</strong></td></tr><tr><td><strong>1</strong></td><td>Materials&nbsp;Usedfor&nbsp;Design&nbsp;Mix</td><td>3</td></tr><tr><td><strong>2</strong></td><td>Data&nbsp;for&nbsp;Design&nbsp;