ngredients</strong></p></td><td><p>&nbsp;</p><p><strong>Ratio</strong></p></td><td><p>&nbsp;</p><p>&nbsp;</p><p><strong>Mix&nbsp;Proportion&nbsp;in&nbsp;kg/m3</strong></p></td><td><strong>Compressive&nbsp;Strength by Normal Curing Method (N/mm2)</strong></td></tr><tr><td><p><strong>Cement</strong></p><p><strong>(ramco opc 53)</strong></p></td><td><strong>1.0</strong></td><td><strong>4</strong>10</td><td rowspan=\"2\"><p><strong>7DAYS</strong></p><p><strong>37.20</strong></p></td></tr><tr><td><strong>M. Sand</strong></td><td><strong>1.87</strong></td><td><strong>766</strong></td></tr><tr><td><strong>CA&nbsp;20&nbsp;mm</strong></td><td rowspan=\"2\"><strong>2.87</strong></td><td><strong>707</strong></td><td rowspan=\"4\"><p><strong>28 DAYS</strong></p><p><strong>48.50</strong></p></td></tr><tr><td><strong>CA&nbsp;12.5&nbsp;mm</strong></td><td><strong>468</strong></td></tr><tr><td rowspan=\"2\"><p><strong>Slump (mm)</strong></p><p><strong>Minutes</strong></p></td><td><strong>60 MIN</strong></td><td><strong>170</strong></td></tr><tr><td><strong>120 MIN</strong></td><td><strong>110</strong></td></tr><tr><td><strong>Total Water Required at Trial mix Excluding water&nbsp;Absorption (Max) (Litre)</strong></td><td colspan=\"2\"><strong>156</strong></td><td>&nbsp;</td></tr><tr><td><strong>W/C&nbsp;Ratio(%)</strong></td><td colspan=\"2\"><strong>0.38</strong></td><td rowspan=\"2\">&nbsp;</td></tr><tr><td><strong>Admixture (kg)</strong></td><td colspan=\"2\"><strong>2.05</strong></td></tr></tbody></table></figure>',3,3,3,1),(81,'PRELIMINARY REPORT ON DESIGN FOR CONCRETE MIX OF GRADES M7','2024-01-30 09:48:23.447060','2024-02-19 05:17:31.501527','<figure class=\"table\"><table><tbody><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td>Ref CCTL- CBE/cube/24</td><td>Date :</td></tr><tr><td>Test Order</td><td>Page No : 1</td></tr><tr><td><strong>CUSTOMERDETAILS</strong></td><td>&nbsp;</td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>Project*</td><td>:</td><td>Project Name</td></tr><tr><td>Place of Testing</td><td>:</td><td><strong>Place of Testing Name</strong></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>A.</strong></td><td colspan=\"2\"><strong>INTRODUCTION:</strong></td></tr><tr><td colspan=\"3\">On reference from <strong>#ADDRESSINFO#</strong> vide their letter Nil dated <strong>#DATE1#</strong> sample received on date <strong>#DATE2# &nbsp;</strong>design of concrete mix for #MATERIAL# grades of concrete were taken up for the project <strong>#PROJECTADDRESSINFO#</strong>, in our laboratories vide our Test Order No. <strong>#TESTORDERNO#</strong> dated <strong>#TESTORDERDATE#</strong><br><br>The Important criteria kept in view while designing the concrete mixes are strength, durability and workability of concrete. Various methods employed for concrete mix design, such as, ACI, and IS have been referred to. The mix proportion is arrived at theoretically, based on IS recommendations. Appropriate modifications are made depending on the material properties observed and also the specific requirements of the job. Concrete cubes are cast and tested for compressive strength at the end of 7 days &amp; 28 days.</td></tr><tr><td><strong>B.</strong></td><td colspan=\"2\"><strong>MATERIALS:</strong></td></tr><tr><td>1.</td><td>Cementations material:Cement:</td><td>Brands/Type: RAMCO OPC 53<br>(As furnished by the customer)</td></tr><tr><td>2.</td><td>Aggregates:<br>a) Fine aggregate<br>b) Coarse aggregate</td><td>M Sand.Angular crusher broken coarse aggregate of max size 20mm.<br>(Source: M/s V Rasappan &amp; Co, Tiruppur)</td></tr><tr><td>3.</td><td>Admixture:</td><td>Auramix 200 &amp; Auramix 400- M/S FOSROC</td></tr><tr><td colspan=\"3\">The characteristics of the materials are given in Tables 1 – 5. Water used in the laboratory for trial cast is potable.</td></tr></tbody></table></figure><p><a href=\"javascript:void(0)\">--Page Break---</a>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>C.</strong></td><td colspan=\"2\"><strong>DATA FOR MIX DESIGN:</strong></td></tr><tr><td>1.</td><td>Mix to be designed</td><td>M7.5, M40 &amp; M55 with aggregates of maximum size 20mm.</td></tr><tr><td>2.</td><td>Characteristic compressive strength of concrete at 28 days (fck)</td><td>For M7.5, it is 7.50 N/sq.mm For M40, it is 40.0 N/sq.mm For M55, it is 55.0 N/sq.mm</td></tr><tr><td>3.</td><td>Desired degree of workability.</td><td>Corresponding to a 90 - 130mm slump</td></tr><tr><td>4.</td><td>Type and maximum size of aggregate supplied.</td><td>Granite, angular 20mm and down</td></tr><tr><td>5.</td><td>Expected degree of quality control in the field.</td><td>Control level A*</td></tr><tr><td>6.</td><td>Target mean compressive strength of concrete at 28 days</td><td>For M7.5, it is 13.28 N/sq.mm For M40, it is 48.25 N/sq.mm For M55, it is 63.25 N/sq.mm</td></tr><tr><td>7.</td><td>Type of exposure</td><td>Moderate **</td></tr><tr><td colspan=\"3\">* Site control level A corresponds to proper storage of cement, weigh-batching of all materials, controlled addition of water, regular checking of all materials, aggregate grading and moisture content and periodical checking of workability and strength.</td></tr><tr><td colspan=\"3\">** IS:456-2008 describes ‘Moderate’ as Concrete surfaces sheltered from server rain or freezing whilst wet ; Concrete exposed to condensation and concrete continuously under water ; Concrete in contact or buried under non-aggressive soil/ground water ; concrete surface sheltered From Saturated salt air in coastal area.</td></tr></tbody></table></figure><p><a href=\"javascript:void(0)\">--Page Break---</a>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>D.</strong></td><td><strong>DESIGN MIX:</strong></td></tr><tr><td>&nbsp;</td><td>To satisfy the requirements mentioned in the data for mix design the proportion by weight listed in Table-6 has been arrived at, with marginal adjustments of trial mix for M7.5, M40 &amp; M55 grades of concrete using aggregates of 20.0mm down. A number of trial castings have been made and the best suitable proportion based on re-produce ability of 7 days compressive strength has been furnished.</td></tr><tr><td><strong>E.</strong></td><td><strong>RECOMMENDATIONS:</strong></td></tr><tr><td>&nbsp;</td><td>Compressive strength test results of the trial specimens cast in our laboratory are furnished in Table-6. It can be seen that 28-day strength is greater than 100% of the target mean compressive strength indicated in item C. As such, it is recommended that the concrete mix proportions indicated in Table-6 be adopted at site. However, this shall be confirmed only after 28-day strength test results are available.</td></tr></tbody></table></figure><p><a href=\"javascript:void(0)\">--Page Break---</a>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>F.</strong></td><td colspan=\"2\"><strong>REMARKS:</strong></td></tr><tr><td>1.</td><td>The design mixes are applicable only for those OPC whose properties are similar to the one supplied to us for conducting the mix design.</td><td>&nbsp;</td></tr><tr><td>2.</td><td>All the materials shall be weighing batched. Suitable corrections are to be applied for weight of aggregates, if they are not saturated and surface dry.</td><td>&nbsp;</td></tr><tr><td>3.</td><td>The bulk density and specific gravity of materials to be used shall be confirmed by testing of such materials from time to time. If any deviations in the above parameters are observed, suitable corrections for proportions shall be applied at site.</td><td>&nbsp;</td></tr><tr><td>4.</td><td>Suitable correction is to be applied to water-cement ratio, if the aggregates are not saturated and surface dry.</td><td>&nbsp;</td></tr><tr><td>5.</td><td>Minor adjustments in water-cement ratio (on the lower side) may be carried out in actual work to get the desired slump, if necessary.</td><td>&nbsp;</td></tr><tr><td>6.</td><td>Admixture dosage may be suitably adjusted at site, if required, depending on the actual concrete making materials used.</td><td>&nbsp;</td></tr><tr><td>7.</td><td>The sand to be used shall be free from all deleterious materials like silt, clay, mica and other organic impurities. The gradation shall be same as that used in the design mix.</td><td>&nbsp;</td></tr><tr><td>8.</td><td>The coarse aggregates and fine aggregate used shall conform to the graded aggregate requirements as given in IS: 383-1970 (Reaffirmed - 2007).</td><td>&nbsp;</td></tr><tr><td>9.</td><td>At site, it is suggested to use suitable vibrators for compaction.</td><td>&nbsp;</td></tr><tr><td>10.</td><td>The quality of water to be used for concreting shall conform to IS: 456-2000.</td><td>&nbsp;</td></tr><tr><td>11.</td><td>In the design calculations, the degree of quality control considered is Control Level A. Hence, it is mandatory to exercise at least the same degree of quality control in the actual work.</td><td>&nbsp;</td></tr></tbody></table></figure><p>*********</p><p><a href=\"javascript:void(0)\">--Page Break---</a>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>G.</strong></td><td colspan=\"2\"><strong>REFERENCES:</strong></td></tr><tr><td>1.</td><td>IS:10262-2019</td><td>Recommended guidelines for concrete mix design.</td></tr><tr><td>2.</td><td>SP:23(S&amp;T)-1982</td><td>Handbook on concrete mixes.</td></tr><tr><td>3.</td><td>IS:456-2000(RA 2005)</td><td>Code of Practice for plain &amp; reinforced concrete.</td></tr><tr><td>4.</td><td>IS:516-1959 (Reaffirmed 2008)</td><td>Method of test for strength of concrete.</td></tr><tr><td>5.</td><td>IS:383-2016</td><td>Indian Standard specifications for coarse and fine aggregates from natural sources for concrete.</td></tr><tr><td>6.</td><td>IS:1199-1959 (Reaffirmed 2008)</td><td>Indian Standard specifications for methods of sampling and analysis of concrete.</td></tr><tr><td>7.</td><td>IS:8112-1989 (Reaffirmed 2009)<