p;</p><p>&nbsp;</p><p><strong>Calibrated By&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Certified By</strong></p>',2,2,2,1),(86,'Quotation','2024-03-01 09:08:33.356115','2024-03-01 09:08:33.356151','<figure class=\"table\"><table><tbody><tr><td colspan=\"2\"><figure class=\"image\"><img style=\"aspect-ratio:1137/129;\" src=\"https://files.covaiciviltechlab.com/static/header.gif\" alt=\"Logo\" width=\"1137\" height=\"129\"></figure></td></tr><tr><td><h2><strong>QUOTATION&nbsp;</strong></h2></td><td>Date : 2024-02-29</td></tr><tr><td><p><strong>M/S TVS INDUSTRIAL &amp; LOGISTICS PARKS PRIVATE LIMITED&nbsp;</strong></p><p><strong>chennai&nbsp;</strong></p></td><td>&nbsp;</td></tr></tbody></table></figure><p>Dear&nbsp;Sir,</p><p>&nbsp;</p><p><strong>Sub </strong>: Quotation for Rebound hammer</p><p>&nbsp;</p><p>Sending this quote as per our discussion regarding&nbsp;the test&nbsp;at the&nbsp;identified&nbsp;location. Please find the details as below:</p><figure class=\"table\"><table><tbody><tr><td><strong>S.&nbsp;No&nbsp;</strong></td><td><strong>WORK DESCRIPTION&nbsp;</strong></td><td><strong>UNIT&nbsp;</strong></td><td><strong>RATE&nbsp;</strong></td><td><strong>AMOUNT&nbsp;</strong></td></tr><tr><td>1</td><td>Rebound hammer</td><td>L/S</td><td>15000</td><td>13,500.00</td></tr><tr><td colspan=\"4\">Sub Total</td><td>13,500.00</td></tr><tr><td colspan=\"4\">CGST (9%) + SGST (9%)</td><td>2,430.00</td></tr><tr><td colspan=\"4\"><strong>Total&nbsp;</strong></td><td><strong>15,930.00&nbsp;</strong></td></tr></tbody></table></figure><h2>Payment&nbsp;terms:</h2><p>1. 50% of the sub total to be paid along with the Work Order.</p><p>2. The remaining amount is to be paid immediately upon completion of work.</p><p>3. Tax Deduction at Source (TDS), if applicable shall be effected when a suitable certificate is issued along with the payment.</p><figure class=\"table\"><table><tbody><tr><td colspan=\"2\"><strong>SCOPE OF THE WORK&nbsp;</strong></td></tr><tr><td><strong>COVAI CIVIL TECH LAB&nbsp;</strong></td><td><strong>M/s TVS INDUSTRIAL &amp; LOGISTICS PARKS PRIVATE LIMITED&nbsp;</strong></td></tr><tr><td><ul><li>REBOUND HAMMER</li><li>Sample from RC members</li><li>Conducting tests on compressive strength for relevant I.S. standards.</li><li>Provide a test report within 1 days after the completion of the test at the site.</li></ul><p>&nbsp;</p></td><td><h2>Provide Work Completion Letter or Certificate while giving test report.</h2><p>Chipping work will come under your scope.</p><p>&nbsp;</p></td></tr></tbody></table></figure>',2,1,2,1),(87,'mix d','2024-03-15 07:32:08.768276','2024-03-15 07:32:08.768335','<figure class=\"table\"><table><tbody><tr><td><strong>A.</strong><br>&nbsp;</td><td colspan=\"2\"><strong>INTRODUCTION:</strong></td></tr><tr><td>&nbsp;</td><td colspan=\"2\"><p>On reference from<strong>M/s.Nimalaan Engineers LLP,No.42B, Rajarajeshwari Nagar, Madipakkam, Chennai -600091,</strong>vide their letter Nil dated 27.02.2023 sample received on date 27.02.2023 design of concrete mix for <strong>M7.5,M40&amp; M55</strong>grades of concrete were taken up for the project<strong>M/sJSW Renew Energy Limited (Wind Turbine Foundations) AtDharapuram,</strong>in our laboratories vide our Test Order No.2838dated 06.03.2023</p><p>&nbsp;</p><p>The Important criteria kept in view while designing the concrete mixes are strength, durability and workability of concrete. Various methods employed for concrete mix design, such as,&nbsp; ACI, and IS have been referred to.&nbsp; The mix proportion is arrived at theoretically, based on IS recommendations.&nbsp; Appropriate modifications are made depending on the material properties observed and also the specific requirements of the job. Concrete cubes are cast and tested for compressive strength at the end of 7 days&amp; 28 days.</p></td></tr><tr><td><strong>B.</strong></td><td colspan=\"2\"><strong>MATERIALS:</strong></td></tr><tr><td>1.</td><td><p><strong>Cementations material:</strong></p><ol><li>Cement:</li></ol><p>&nbsp;</p></td><td><p>&nbsp;</p><h2>Brands/Type: <strong>RAMCOOPC 53</strong></h2><h2>(As furnished by the customer)</h2></td></tr><tr><td>2.</td><td><p><strong>Aggregates:</strong></p><p>a)&nbsp; Fine aggregate</p><p>b)&nbsp; Coarse aggregate</p></td><td><h2>&nbsp;</h2><p>M Sand.</p><p>&nbsp;</p><h2>Angularcrusher broken coarse aggregate of max size 20mm.&nbsp;</h2><p>(Source: M/s V Rasappan&amp; Co, Tiruppur)</p></td></tr><tr><td>3.</td><td><strong>Admixture:</strong></td><td><strong>Auramix 200 &amp;Auramix400- M/S FOSROC</strong></td></tr><tr><td colspan=\"3\">The characteristics of the materials are given in Tables 1 – 5.&nbsp; Water used in the laboratory for trial cast is potable.</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p><br>&nbsp;</p><p><strong>C.</strong></p></td><td colspan=\"2\"><p><strong>DATA FOR MIX DESIGN:</strong></p><p>&nbsp;</p></td></tr><tr><td>1.</td><td>Mix to be designed</td><td>M7.5, M40&amp; M55 with aggregates of maximum size 20mm.</td></tr><tr><td>2.</td><td>Characteristic compressive strength of concrete at 28 days (fck)</td><td><p>For M7.5, it is 7.50 N/sq.mm</p><p>For M40, it is 40.0 N/sq.mm</p><p>For M55, it is 55.0 N/sq.mm</p></td></tr><tr><td>3.</td><td>Desired degree of workability.</td><td><p>Corresponding to a 90 - 130mm slump&nbsp;</p><p>&nbsp;</p></td></tr><tr><td>4.</td><td>Type and maximum size of aggregate supplied.</td><td><p>Granite, angular 20mm and down</p><p>&nbsp;</p><p>&nbsp;</p></td></tr><tr><td>5.</td><td>Expected degree of quality control in the field.</td><td><p>Control level A*</p><p>&nbsp;</p></td></tr><tr><td>6.</td><td>Target mean compressive strength of concrete at 28 days</td><td><p>For M7.5, it is 13.28 N/sq.mm</p><p>For M40, it is 48.25 N/sq.mm</p><p>For M55, it is 63.25 N/sq.mm</p><p>&nbsp;</p></td></tr><tr><td>7.</td><td>Type of exposure</td><td>Moderate**</td></tr><tr><td colspan=\"3\">* Site control level A corresponds to proper storage of cement, weigh-batching of all materials, controlled addition of water, regular checking of all materials, aggregate grading and moisture content and periodical checking of workability and strength.&nbsp; &nbsp;</td></tr><tr><td colspan=\"3\"><p>** IS:456-2008 describes ‘Moderate’ as Concrete surfaces sheltered from server rain or freezing whilst wet ; Concrete exposed to condensation and concrete continuously under water ; Concrete in contact or buried under non-aggressive soil/ground water ; concrete surface sheltered From Saturated salt air in coastal area.</p><p>&nbsp;</p></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p><br><br>&nbsp;</p><p><strong>D.</strong></p></td><td><p><strong>DESIGN MIX:</strong></p><p>&nbsp;</p></td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>To satisfy the requirements mentioned in the data for mix design the proportion by weight listed in Table-6has been arrived at, with marginal adjustments of trial mix for <strong>M7.5</strong>, <strong>M40&amp; M55</strong>grades of concrete using aggregates of 20.0mm down.&nbsp; &nbsp;A number of trial castings have been made and the best suitable proportion based on re-produce ability of 7days compressive strength has been furnished.</td><td>&nbsp;</td></tr><tr><td><strong>E.</strong></td><td><strong>RECOMMENDATIONS:</strong></td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>Compressive strength test results of the trial specimens cast in our laboratory are furnished in Table-6.&nbsp; It can be seen that 28-day strength is greater than 100% of the target mean compressive strength indicated in item C.&nbsp; As such, it is recommended that the concrete mix proportions indicated in Table-6 be adopted at site. However, this shall be confirmed only after 28-day strength test results are available.</td><td>&nbsp;</td></tr><tr><td><strong>F.</strong></td><td><strong>REMARKS:</strong></td><td>&nbsp;</td></tr><tr><td><p>1.</p><p>&nbsp;</p><p>&nbsp;</p><p>2.</p><p>&nbsp;</p><p>&nbsp;</p><p>3.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>4.</p></td><td><p>The design mixes are applicable only for those OPCwhose properties are similar to the one supplied to us for conducting the mix design.</p><p>&nbsp;</p><p>All the materials shall be weighing batched.&nbsp; Suitable corrections are to be applied for weight of aggregates, if they are not saturated&nbsp; &nbsp;and surface dry.</p><p>&nbsp;</p><p>The bulk density and specific gravity of materials to be used shall be confirmed by testing of such materials from time to time.&nbsp; If any deviations in the above parameters are observed, suitable corrections for proportions shall be applied at site.</p><p>&nbsp;</p><p>Suitable correction is to be applied to water-cement ratio, if the aggregates are not saturatedand surface dry.</p><p>&nbsp;</p></td><td>&nbsp;</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><td><p>&nbsp;</p><p>5.</p><p>&nbsp;</p><p>&nbsp;</p><p>6.</p><p>&nbsp;</p><p>&nbsp;</p><p>7.</p><p>&nbsp;</p><p>&nbsp;</p><p>8.</p><p>&nbsp;</p><p>&nbsp;</p><p>9.</p><p>&nbsp;</p><p>10.</p><p>&nbsp;</p><p>11.</p><p>&nbsp;</p></td><td><p>&nbsp;</p><p>Minor adjustments in water-cement ratio (on the lower side) may be carried out in actual work to get the desired slump, if necessary.</p><p>&nbsp;</p><p>Admixture dosage may be suitably adjusted at site, if required, depending on the actual concrete making materials used.</p><p>&nbsp;</p><p>The sand to be used shall be free from all deleterious materials like silt, clay, mica and other organic impurities.&nbsp; The gradation shall be same as that used in the design mix.&nbsp;</p><p>&nbsp;</p><p>The coarse aggregates and fine aggregate used shall conform to the graded aggregate requirements as given in IS: 383-1970 (Reaffirmed - 2007).</p><p>&nbsp;</p><p>At site, it is suggested to use suitable vibrators for compaction.</p><p>&nbsp;</p><p>The quality of water to be used for concreting shall conform to IS: 456-2000.&nbsp;</p><p>&nbsp;</p><p>In the design calculations, the degree of quality control considered is Control Level A. Hence, it is mandatory to exercise at least the same degree of quality control in the actual work.</p></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>G.</strong></td><td colspan=\"2\"><p><strong>REFERENCES:</strong></p><p>&nbsp;</p><p>&nbsp;</p></td></tr><tr><td>1.</td><td>IS:10262-2019</td><td><p>Recommended guidelines for concrete mix design.</p><p>&nbsp;</p></td></tr><tr><td>2.</td><td>SP:23(S&amp;T)-1982</td><td><p>Handbook on concrete mixes.</p><p>&nbsp;</p></td></tr><tr><td>3.</td><td>IS:456-2000(RA 2005)</td><td><p>Code of Practice for plain &amp; reinforced&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;concrete.</p><p>&nbsp;</p></td></tr><tr><td>4.</td><td><p>IS:516-1959 (Reaffirmed 2008)</p><p>&nbsp;</p></td><td>Method of test for strength of concrete.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td></tr><tr><td>5.</td><td>IS:383-2016</td><td><p>Indian Standard specifications for coarse and fine aggregates from natural sources for&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;concrete.</p><p>&nbsp;</p></td></tr><tr><td>6.</td><td>IS:1199-1959 (Reaffirmed 2008)</td><td><p>Indian Standard specifications for methods of&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;sampling and analysis of concrete.&nbsp;</p><p>&nbsp;</p></td></tr><tr><td>7.</td><td>IS:8112-1989 (Reaffirmed 2009)</td><td><p>Indian St